INSERT INTO Animal (Name, KindId, Age, IsMale, IsNeutered, Description, Photo, IsActive) VALUES
	('Csahos', @kutya, 3, 1, 0, 
	'A japán Akita egy nyugodt és méltóságteljes kutya, aki szereti a nyugalmat, a társaságot pedig nem igazán keresi. Magának való jellem, ami azt jelenti, hogy nem kedveli sem a zsúfolt kutyafuttatókat, sem pedig a nagy rendezvényeket, családi összejöveteleket. Ez azonban nem jelenti azt, hogy ne lenne szüksége a társas kapcsolatokra, ellenben ezt az igényét általában a gazdája ki tudja elégíteni. Családi kutyaként is tartható, és a gyerekekkel is kijön, abban az esetben, ha a családhoz tartozak.
	<br/>Érdemes azonban tudni, hogy magánakvaló jelleme miatt az idegeneket, ismeretlen gyerekeket, illetve az egyéb háziállatokat nem igazán kedveli. Éppen ezért, ha látogatók érkeznek hozzánk, ne hagyjuk kedvencünket felügyelet nélkül. Megfelelő összeszoktatás mellett persze más kutyákkal jó kapcsolatot alakíthat ki. A kisebb állatokat, például macskákat azonban zsákmánynak is tekintheti.', 
	'', 1);	

INSERT INTO Animal (Name, KindId, Age, IsMale, IsNeutered, Description, Photo, IsActive) VALUES
	('Bátor', @kutya, 24, 0, 0, 
	'Bátor rendelkezik a keverék kutyák minden bájával. Kedves, jóindulatú, nyugodt természete miatt kisgyerekek mellé is nyugodt szívvel ajánljuk, igazi kis társunk lehet.', 
	'', 1);
	
INSERT INTO Animal (Name, KindId, Age, IsMale, IsNeutered, Description, Photo, IsActive) VALUES
	('Kócos', @kutya, 36, 0, 1, 
	'Kócos különleges, szeretetre éhes, 3 év körüli, puli keverék kutyus. Nagyon kedves, bájos, okos, imádja a simogatást, bálványként tekint az emberre. Új gazdája igazi kis négylábú társra talál majd benne! Nagyon szeret sétálni, más kutyákkal is jó a viszonya. ', 
	'', 1);	

INSERT INTO Animal (Name, KindId, Age, IsMale, IsNeutered, Description, Photo, IsActive) VALUES
	('Cirmi', @macska, 4, 1, 1, 
	'Nagyon kedves, barátságos, első cicának is ideális. Szeret játszani, de nem hiperaktív, szeret az ember körül dorombolva jönni-menni, az ember hasán, mellkasán pihenni.', 
	'', 1);	

INSERT INTO Animal (Name, KindId, Age, IsMale, IsNeutered, Description, Photo, IsActive) VALUES
	('Mirci', @macska, 36, 0, 1, 
	'Bár elsőre félénk lehet idegenekkel, de ha egyszer megismer téged, hűséges társad lesz. Leginkább az ablakban ülve és kíváncsian nézelődve érzi magát otthon. Az étel az ő mindene, szereti a finom falatokat. A személyisége alapján egyedüli cicának javaslom.', 
	'', 1);	

INSERT INTO Animal (Name, KindId, Age, IsMale, IsNeutered, Description, Photo, IsActive) VALUES
	('Füles', @egyeb, 12, 0, 1, 
	'Füles kicsit félénk nyuszi, de hamar megbarátkozik, és onnantól kezdve érdeklődő, kedves társunk lehet.', 
	'', 1);	

INSERT INTO Animal (Name, KindId, Age, IsMale, IsNeutered, Description, Photo, IsActive) VALUES
	('Csöpi', @egyeb, 12, 1, 1, 
	'Egy éves sötét szürke hím csincsilla szerető, gondoskodó gazdit keres. Viszont tudd, hogy a csincsilla éjszakai állat, és nem éppen a legcsendesebb fajtából. Ezt vedd figyelembe! Ezért ha az a típus vagy, aki korán fekszik, és minden apró neszre felébred, akkor sem való számodra a csincsilla. A nappali életmódra átszoktatás, náluk nem opció. Így kell őket elfogadni.', 
	'', 1);	

